```json
{
"application": "DIAMOND",
"details": {
"description": "This script uses DIAMOND to map query sequences against a protein database.",
"usage": "-d <DATABASE> Path to the DIAMOND database.\n-q <QUERY> Path to the query file containing nucleotide sequences.\n-o <OUTPUT_PATH> Path to the output file.",
"options": {
"-m <MEMORY>": "Memory available in GB. DIAMOND blocksize is set to MEMORY/10. Default: 10",
"-t <TEMP_DIR>": "Path to the temporary directory. Default: ./diamond_temp",
"-e <EVALUE>": "Max evalue. Default: 10",
"-f <OUT_FORMAT>": "Output format. Default: '6 qseqid stitle sseqid staxids evalue bitscore pident length'",
"-l <LOG_FILE>": "Path to the log file. Default: No log file.",
"-s <SAMPLE_ID>": "Name of the sample, used for logging purposes. Default: Basename of query.",
"-T <DIAMOND_TYPE>": "In what mode to run DIAMOND. Options are 'blastx' or 'blastp'. Default: 'blastx'"
},
"resources": {
"memory": "10GB",
"cores": "2",
"modules": "gcc"
},
"dependencies": {
"diamond": "DIAMOND is a sequence alignment tool that is used to search for homologous sequences in a database."
},
"output": "The output of the script is a file containing the results of the alignment. The output format is specified by the -f option."
}
}
```
